  true,\n\t\"url\": null,\n\t\"notes\": \"The Global Reservoir and Dam Database, Version
  1 (Revision 01) contains 6,862 records of reservoirs and their associated dams with
  a cumulative storage capacity of 6,197 cubic nnkm. The dams were geospatially referenced
  and assigned to polygons depicting reservoir outlines at high spatial resolution.
  Dams have multiple attributes, such as name of the dam and nnimpounded river, primary
  use, nearest city, height, area and volume of reservoir, and year of construction
  (or commissioning). While the main focus was to include all dams associated with
  nnreservoirs that have a storage capacity of more than 0.1 cubic kilometers, many
  smaller dams and reservoirs were added where data were available. The data were
  compiled by Lehner et al. nn(2011) and are distributed by the Global Water System
  Project (GWSP) and by the Columbia University Center for International Earth Science
  Information Network (CIESIN). For details please nnrefer to the Technical Documentation
  which is provided with the data.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
